                        <UserIcon />
                    </WrapperInput>
                    <WrapperInput>
                        <Input onChange={handleChange}/>
                        <label htmlFor="">E-mail</label>
                        <PassIcon />
                    </WrapperInput>
                    <Button type="submit">Login</Button>
                    <LoginInfo>
                        <span>Lembrar de mim</span>
                        <span>Esqueceu a senha?</span>
                    </LoginInfo>
                </FormUser>
            </WrapperForm>
        </Container>
    );
};

export default Form;
